import React from "react";

const logout = (props) => {
  const handleLogout = () => {
    props.history.push("/login");
  };
  return (
    <div className="navbar">
      <h1>Hello</h1>
      <ul>
        <li className="btn" onClick={handleLogout} value="Logout">
          Logout
        </li>
      </ul>
    </div>
  );
};

export default logout;
